import React, { Component } from 'react';
import axios from 'axios';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      modelData: null,
      error: null,
      loading: false
    };
  }

  componentDidMount() {
    this.fetchModelData();
  }

  fetchModelData = async () => {
    try {
      this.setState({ loading: true });
      // You can add a model_id query parameter if needed
      const response = await axios.get('http://127.0.0.1:8000/api/model/');
      this.setState({ 
        modelData: response.data,
        loading: false 
      });
    } catch (error) {
      this.setState({ 
        error: 'Error fetching data from server',
        loading: false 
      });
      console.error('Error:', error);
    }
  };

  render() {
    const { modelData, error, loading } = this.state;

    return (
      <div className="App">
        <header className="App-header">
          <h1>CBM GUI Application</h1>

          {loading && <p>Loading...</p>}

          {error && <p style={{ color: 'red' }}>{error}</p>}

          {modelData && (
            <div>
              <h2>Model Data:</h2>
              <pre>{JSON.stringify(modelData, null, 2)}</pre>
            </div>
          )}
        </header>
      </div>
    );
  }
}

export default App;
